import React from "react";

function Card(props){
    return <div className="card">
    <div className="top">
      <h1>My Contacts</h1>

      <h2 className="name">{props.name}</h2>
      <img
        src={props.image}
        alt={props.name + "Image"}
        className="img circle-img"
      />
    </div>
      <div className="bottom">
        <p>{props.tel}</p>
        <p>{props.email}</p>
      </div>
    </div>
}

export default Card;
